import React from 'react';
import Input from './Input.js';
import Button from './Button.js';

const Form = () => {
  return (
    <form action="">
      <p>
        <label htmlFor="nome">Nome</label>
        <Input />
      </p>
      <p>
        <label htmlFor="Email">Email</label>
        <Input />
      </p>
      <Button />
    </form>
  );
};

export default Form;
